<script>
function updateLegend(name) {
    var colors = {
        "OSM Estándar": {texto:"#4A4A4A"},
        "Google Maps - Calles": {texto:"#2E2E2E"},
        "Google Satélite": {texto:"#FFFFFF"}
    };
    var c = colors[name];
    if (!c) return;
    document.getElementById('legend').innerHTML = `
        <b>Leyenda - ${name}:</b><br>
        <ul style='margin: 5px 0; padding-left: 15px;'>
            <li style='list-style:none;'><span style='color:#FF0000; font-size:16px; text-shadow:-1px -1px 0 #222, 1px -1px 0 #222, -1px 1px 0 #222, 1px 1px 0 #222;'>★</span> PATRIMONIO (DELITO)</li><li style='list-style:none;'><span style='color:#0000FF; font-size:16px; text-shadow:-1px -1px 0 #222, 1px -1px 0 #222, -1px 1px 0 #222, 1px 1px 0 #222;'>★</span> SEGURIDAD PUBLICA (DELITO)</li><li style='list-style:none;'><span style='color:#00FF00; font-size:16px; text-shadow:-1px -1px 0 #222, 1px -1px 0 #222, -1px 1px 0 #222, 1px 1px 0 #222;'>★</span> TRAFICO ILICITO DE DROGAS</li><li style='list-style:none;'><span style='color:#FFFF00; font-size:16px; text-shadow:-1px -1px 0 #222, 1px -1px 0 #222, -1px 1px 0 #222, 1px 1px 0 #222;'>★</span> TRANQUILIDAD PUBLICA (DELITO)</li><li style='list-style:none;'><span style='color:#FF00FF; font-size:16px; text-shadow:-1px -1px 0 #222, 1px -1px 0 #222, -1px 1px 0 #222, 1px 1px 0 #222;'>★</span> VIDA, EL CUERPO Y LA SALUD (DELITO)</li>
        </ul>`;
}

// --- Ajuste dinámico del tamaño de las estrellas según el zoom ---
map.on('zoomend', function() {
    var zoom = map.getZoom();
    var size = 10 + (zoom * 0.8);  // tamaño proporcional (agradable visualmente)
    var stars = document.getElementsByClassName('star-icon');
    for (var i = 0; i < stars.length; i++) {
        stars[i].style.fontSize = size + 'px';
        stars[i].style.opacity = Math.min(1, 0.6 + (zoom / 15)); // más visibles al acercar
    }
});

map.on('baselayerchange', function(e) {
    updateLegend(e.name);
});
</script>
